import React, {createContext} from 'react';
const themeContext = React.createContext('dark');
const Theme = ({ children }) => {
  return (
        <div>
            <themeContext.Provider value={'dark'}>
                {children}
            </themeContext.Provider>
        </div>
    )
}
export { themeContext, Theme };
